            </button>

          {!isAuthenticated ? (
            <button className="login-btn" onClick={() => navigate('/login')}>
            ƒêƒÉng nh·∫≠p
           </button>
            ) : (
          <label className="admin-switch">
    <input
      type="checkbox"
      onChange={(e) => {
        if (e.target.checked) navigate('/admin');
      }}
    />
    <span>Trang qu·∫£n tr·ªã ({user.role})</span>
  </label>
)}
            <button className="icon-btn mobile-only">
              <Menu size={22} />
            </button>
          </div>

        </div>
      </nav>

      {/* ===== HERO ===== */}
